import React from "react";
import { UserPlus, ClipboardPlus } from "lucide-react";
import { Link } from "react-router-dom";

const Registration = () => {
  return (
    <div className=" w-full mb-8">
        <Link to="registration">
            <div id="go-to-register" className="task-card bg-white p-8 rounded-lg shadow cursor-pointer border-l-4 border-purple-500">
                <UserPlus className="h-12 w-12 text-purple-600 mb-4" />
                <h3 className="text-xl font-bold text-gray-800">Register New Migrant</h3>
                <p className="text-gray-600 mt-1">
                Create a new health profile for a migrant worker.
                </p>
            </div>
        </Link>
    </div>
  );
};

export default Registration;
